const readVarint: (buffer: string, ctx: {offset: number}) => number = (buffer, ctx) => {
  let n = 0;
  for (let i = 0; i < 4; i++, ctx.offset++) {
    if (ctx.offset === buffer.length) {
      throw new Error("Truncated buffer");
    };
    const chunk = buffer.charCodeAt(ctx.offset) & 127;
    n |= chunk << i * 7;
    if ((buffer.charCodeAt(ctx.offset) & 128) === 0) {
      ctx.offset++;
      return n >>> 0;
    }
  };
  throw new Error(`Varint at offset ${ctx.offset} exceeds maximum encodable length of 4`);
};
const decodeRanges: (rangesBase64: string) => Generator<number | [number, number], void, void> = function* (rangesBase64) {
  let prev = 0;
  const ranges = atob(rangesBase64);
  const ctx = { offset: 0 };
  while (ctx.offset < ranges.length) {
    const firstEnc = readVarint(ranges, ctx);
    const isRange = !!(firstEnc & 1);
    const first = (firstEnc >>> 1) + prev;
    if (isRange) {
      const second = readVarint(ranges, ctx) + first;
      yield [first, second];
    } else {
      yield first;
    };
    prev = first;
  }
};

export const subsetRanges = (subsetName: SubsetName): Generator<number | [number, number], void, void> => decodeRanges(SUBSET_RANGES[subsetName]);

